def evaluate_wrestlers(T, N, M, F, S):
    results = []
    for i in range(T):
        n = N[i]
        m = M[i]
        f = F[i]
        x = S[i]
        (my, fy) = (0, 0)
        check = [0] / n
        for j in range(n):
            if x[j] > 0 and x[j] % m == 0 and (check[j] == 0):
                check[j] = 1
                my += 1
        for j in range(n):
            if x[j] > 0 and x[j] % f == 0 and (check[j] == 0):
                check[j] = 1
                fy += 1
        if (my + fy) * 1.0 / n * 100 >= 70:
            if my > fy:
                results.append(('Yes', 'Multan'))
            elif fy > my:
                results.append(('Yes', 'Fultan'))
            else:
                results.append(('Yes', 'Both'))
        else:
            results.append(('No',))
    return results

